var exec = require('child_process').exec;

export default (req, res) => {

    var child = exec('code .', function(error, stdout, stderr){
        console.log(stdout);
    });

    res.statusCode = 200
    res.setHeader('Content-Type', 'application/json')
    res.end(JSON.stringify({ name: 'John Doe' }))
}
